import { DateRangePicker, DateRange } from "materialui-daterange-picker";
const GET_SERVICES_REQUEST = "GET_SERVICES_REQUEST";
const GET_SERVICES_SUCCESS = "GET_SERVICES_SUCCESS";

const ClearButton = styled(Button)`
